function add(a,b){
    let sum = a + b;
    return sum;
}
function sub(a,b){
    let sum = a - b;
    return sum;
}
function div(a,b){
    let sum = a / b;
    return sum;
}
function multi(a,b){
    let sum = a * b;
    return sum;
}
export {add,sub,div,multi};
